import React from 'react';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import { makeStyles } from '@material-ui/core/styles';
//import TestWeather from './weatherWidget.js'
import './login.css';

const useStyles = makeStyles((theme) => ({
  root: {
    '& .MuiTextField-root': {
      margin: theme.spacing(1),
      width: '25ch',
    },
  },
}));

function TestWeather() {

  return (
      <a target="_blank" href="https://hotelmix.fr/weather/drancy-54374"><img src="https://w.bookcdn.com/weather/picture/4_54374_1_3_137AE9_160_ffffff_333333_08488D_1_ffffff_333333_0_6.png?scode=124&domid=581&anc_id=27348"  alt="booked.net"/></a>
  );
}

export default function FormPropsTextFields() {
  const classes = useStyles();

  return (
    <form className={classes.root} noValidate autoComplete="off" class="center-middle">
      <div>
        <TextField
          id="standard-user-input"
          label="user"
          type="user"
          autoComplete="current-user"
        />
        <TextField
          id="standard-password-input"
          label="password"
          autoComplete="current-password"
        />
      </div>
      <center>
        <Button variant="outlined" color="primary" onClick="TestWeather()">
          Log in
        </Button>
      </center>
    </form>
  );
}
